const Cart = ({ products, setProducts }) => {
  //total
  let soustotal = 0;
  for (let i = 0; i < products.length; i++) {
    soustotal =
      soustotal.toFixed(2) + Number(products[i].price) * products[i].quantity;
  }

  const fraisDeLivraison = 2.5;

  let absoluteTotal = soustotal + fraisDeLivraison;

  return (
    <div className="cart">
      <button className={soustotal === 0 ? "cart-button-empty" : "valider"}>
        Valider mon panier
      </button>

      <div>
        <div
          className={
            soustotal === 0 ? "cart-empty" : "cart-middle-section-full"
          }
        >
          {soustotal === 0 && <div>Votre panier est vide</div>}
          {products.map((product, index) => {
            const handlePlusClick = () => {
              const newProduct = [...products];
              newProduct[index].quantity++;
              setProducts(newProduct);
            };

            const handleMinusClick = () => {
              const newProduct = [...products];
              if (newProduct[index].quantity === 1) {
                newProduct.splice(index, 1);
              } else {
                newProduct[index].quantity--;
              }
              setProducts(newProduct);
            };

            //Linetotal
            let producttotal = 0;
            producttotal =
              Number(products[index].price) * products[index].quantity;

            return (
              <div className="product-global">
                <div className="product-line-main-container">
                  <div className="product-buttons">
                    <img
                      onClick={handleMinusClick}
                      src="data:image/png;base64,"
                      alt="icon-minus"
                    />
                    {product.quantity}
                    <img
                      onClick={handlePlusClick}
                      src="data:image/png;base64,"
                      alt="icon-plus"
                    />
                  </div>
                  <div className="product-title">{product.title}</div>
                  <div className="product-price">{producttotal} €</div>
                </div>
              </div>
            );
          })}
        </div>
      </div>
      <div className="cart-bottom-section">
        {soustotal === 0 ? null : (
          <div className="result-line">
            <div className="under-total-group">
              <div className="totals-line-main-container">
                <div>Sous-total</div>
                <div>{soustotal} €</div>
              </div>
              <div className="totals-line-main-container">
                <div>Frais de livraison</div>
                <div>{fraisDeLivraison} €</div>
              </div>
            </div>
            <div className="absolute-totals-line-main-container">
              <div>Total</div>
              <div>{absoluteTotal} €</div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Cart;
